function getViewString( chatString ){
  	var tx = "";
	if( (chatString.lastIndexOf( "[emoji:" ) > chatString.lastIndexOf( "]" ) ) || (chatString.lastIndexOf( "[emoji:[" ) > chatString.lastIndexOf( "]]" ) ) ){//有表情被删
	  	var lastIndex = chatString.lastIndexOf( "[emoji:" );
		chatString = chatString.substr( 0, lastIndex );
		return [false,chatString];
	}
	while( true ){
		var index = chatString.indexOf( "[emoji:" );
		if( index < 0  ){
		  tx += chatString;
		  break;
		}
		tx += chatString.substr(0,index);
		chatString = chatString.substr(index);
		index = chatString.indexOf( "]" );
		var imo = chatString.substr(0,index+1);
		chatString = chatString.substr(index+1);
		imo = imo.replace( /\[emoji:(.*)\]/, "$1" );
		if( imo.indexOf("[") == 0 && chatString.indexOf("]") == 0 ){
			imo += "]";
			chatString = chatString.substr(1);
		}
		imgUrl = faceDictionary[imo];
		tx += "<img src='" + imgUrl + "' " + inputAndOutputStrigAreaSize + "/>";
	}
	return [true, tx];
}